import React from 'react'
import "../styles/PostSender.css"

const PostSender = () => {
    return (
        <div className="postsender">
            <div className="postsender__icons"></div>
            <div className="postsender__content"></div>
            <button>Send Post</button>
        </div>
    )
}

export default PostSender
